      out.write("                        of the great explorer of the truth, the master-builder of human happiness. No one rejects,\r\n");
      out.write("                        dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know\r\n");
      out.write("                        how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again\r\n");
      out.write("                        is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain,\r\n");
      out.write("                        but because occasionally circumstances occur in which toil and pain can procure him some great\r\n");
      out.write("                        pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise,\r\n");
      out.write("                        except to obtain some advantage from it? But who has any right to find fault with a man who\r\n");
      out.write("                        chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that\r\n");
      out.write("                        produces no resultant pleasure? On the other hand, we denounce with righteous indignation and\r\n");
